using System;
using System.Collections.Generic;
using System.Linq;
using System.Web.Configuration;
using System.Web.UI;
using System.Web.UI.HtmlControls;
using System.Web.UI.WebControls;
using DAL;
using DAL.Models;

namespace WebParser
{
  public partial class View : Page
  {
    private static readonly IProductDao Dao = SqlProductsDao.GetInstance();
    private static List<Product> _allProducts;

    public static string DefaultImage =
      "data:image/png;base64,";

    protected void Page_Load(object sender, EventArgs e)
    {
      /* Вызов скраппера*/
      Processor.GetPageFromSource("http://skay.ua/4-samsung/");

      _allProducts = Dao.GetAllProducts().OrderByDescending(q => q.ID).ToList();
      CreateElementsHead();
      var feedsApi = WebConfigurationManager.AppSettings["feedsAPI"];
      gridGlobal.Attributes.Add("data-feedsAPI", feedsApi);
      if (!IsPostBack)
      {
        for (var i = 20; i <= 200; i += 20)
        {
          ProductsOnPage.Items.Add(new ListItem(i.ToString(), i.ToString()));
        }
      }
      ChangePage();
    }

    private void ChangePage()
    {
      var listProducts = _allProducts;

      var currentPage = int.Parse(pageNumber.Text);
      var onPage = int.Parse(ProductsOnPage.SelectedValue);

      if (onPage > listProducts.Count)
      {
        onPage = listProducts.Count;
      }

      var pagesCount = onPage == 0 ? 1 : (int) Math.Ceiling((decimal) listProducts.Count / onPage);

      if (currentPage >= pagesCount)
      {
        currentPage = pagesCount - 1;
      }
      if (onPage > 0)
      {
        var skiped = listProducts.Skip(currentPage * onPage);
        var taked = skiped.Take(onPage);
        var orderedAgain = taked.OrderBy(x => x.ID).ToList();

        orderedAgain.ForEach(FillItem);

        var script = "buildPages(" + pagesCount + ", " + currentPage + ");";
        ScriptManager.RegisterClientScriptBlock(this, GetType(), "changePage", script, true);
      }
    }

    private void FillItem(Product product)
    {
      var row = DivMain.FindControl("DivRow" + product.ID);
      if (row == null)
      {
        row = CreateItemsElement(product.ID, false);
        DivMain.Controls.AddAt(2, row);
      }

      (row.FindControl("ID-" + product.ID) as HtmlGenericControl).InnerHtml = product.ID.ToString();
      (row.FindControl("Date-" + product.ID) as HtmlGenericControl).InnerHtml =
        UnixTimeStampToDateTime(Dao.GetLastPriceByProductID(product.ID).PublishDate).ToString();
      (row.FindControl("Title-" + product.ID) as HtmlGenericControl).InnerHtml = product.Title;
    }

    private void CreateElementsHead()
    {
      var divHead = LibControls.CreateHtmlControl("div",
        "uk-width-1-1 uk-grid uk-grid-small uk-panel uk-panel-box uk-margin-remove uk-text-bold uk-text-large divHead",
        DivMain, "", "DivHeadMain");
      var divHeadIdDate = LibControls.CreateHtmlControl("div", "uk-width-1-5 uk-grid uk-grid-small", divHead, "",
        "divHeadIdDate");
      var divHeadId = LibControls.CreateHtmlControl("div", "uk-width-1-5 uk-text-center", divHeadIdDate, "",
        "divHeadId");
      var divHeadPublishDate = LibControls.CreateHtmlControl("div", "uk-width-4-5 uk-text-center", divHeadIdDate,
        "", "divHeadPublicDate");
      var divHeadTitle = LibControls.CreateHtmlControl("div", "uk-width-3-5 uk-text-center", divHead, "",
        "divHeadTitle");
      LibControls.CreateHtmlControl("label", "", divHeadId, "ID");
      LibControls.CreateHtmlControl("label", "", divHeadPublishDate, "Date");
      LibControls.CreateHtmlControl("label", "", divHeadTitle, "Product");
    }

    private Control CreateItemsElement(int i, bool index = true)
    {
      var divRow = LibControls.CreateHtmlControl("div",
        "uk-width-1-1 uk-grid uk-grid-small uk-panel uk-panel-box uk-margin-remove", index ? DivMain : null, "",
        "DivRow" + i);
      var divRowIdDate = LibControls.CreateHtmlControl("div", "uk-width-1-5 uk-grid uk-grid-small", divRow, "",
        "divRowIdDate" + i);
      var divRowId = LibControls.CreateHtmlControl("div", "uk-width-1-5", divRowIdDate, "", "divRowID" + i);
      var divRowPublishDate = LibControls.CreateHtmlControl("div", "uk-width-4-5 uk-text-center", divRowIdDate, "",
        "divRowPublishDate" + i);
      var divRowTitle = LibControls.CreateHtmlControl("div", "uk-width-3-5 uk-text-left", divRow, "",
        "divRowTitle" + i);
      var divRowButtons = LibControls.CreateHtmlControl("div", "uk-width-1-5 uk-grid uk-grid-small", divRow, "",
        "divRowButtons" + i);
      var divRowButtonEdit = LibControls.CreateHtmlControl("div", "uk-width-1-3 uk-push-1-3 uk-text-right",
        divRowButtons, "", "divRowbtnEdit" + i);
      LibControls.CreateHtmlControl("label", "", divRowId, null, "ID-" + i);
      LibControls.CreateHtmlControl("label", "", divRowPublishDate, null, "Date-" + i);
      LibControls.CreateHtmlControl("label", "", divRowTitle, null, "Title-" + i);

      var editButton = LibControls.CreateButton("EditButton" + i, "uk-button uk-button-link uk-display-inline",
        "Show Product", divRowButtonEdit);
      editButton.Attributes.Add("type", "button");
      editButton.Attributes.Add("onclick", "editProduct(" + i + ")");
      return divRow;
    }

    private static DateTime UnixTimeStampToDateTime(double unixTimeStamp, DateTimeKind mode = DateTimeKind.Utc)
    {
      var dtDateTime = new DateTime(1970, 1, 1, 0, 0, 0, 0, mode);
      dtDateTime = dtDateTime.AddSeconds(unixTimeStamp);
      return dtDateTime;
    }
  }
}